import React from 'react';
import './label.css';
//child component
const Label = (props) => {
    const bookList = props.bookList;
    let label = null;
    if (bookList.length() > 0) {
        label = <label className={props.noDataClass}> {props.text}</label>
    }

    return (
        label
    )
}
export default Label;
